from pattern_to_number import pattern_to_number


def computing_freq(text, k):
    freqs = [0] * 4**k
    for i in xrange(0, len(text) - k + 1):
        pattern = text[i: i+k]
        j = pattern_to_number(pattern)
        freqs[j] += 1
    return freqs

